  false,\n\t\"url\": null,\n\t\"notes\": \"This population historically migrated as
  subyearling smolts, but in recent years, the yearling life history has become more
  common. Environmental conditions associated with dams and reservoirs might be exerting
  strong selection for alteration of life history traits that evolved over millennia.
  This project attempts to determine the extent to which these life history changes
  are due to evolution (genetic change) as opposed to phenotypic plasticity (non-genetic
  response to different environmental conditions).nnSnake River fall Chinook reproductive
  success.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
